pymongo - Invalid document cannot encode object<p>I am trying to find an image with the closest colour in the database given an image using the euclidean algorithm (since I do not really care about the distance, I omit the sqrt). Each item in the database contains the fields <code>r</code>, <code>g</code>, <code>b</code>. </p>

<p>Heres my code to retrieve the result:</p>

<pre><code>r, g, b = utilities.get_avg_rgb(match_image.convert('RGB'))

res = self.database_collection.aggregate([
    {'$set': {
        'diff': {
            '$sum': [{'$pow': [{'$sub': ['$r', r]}, 2]},
                     {'$pow': [{'$sub': ['$g', g]}, 2]},
                     {'$pow': [{'$sub': ['$b', b]}, 2]}]
        }
    }},
    {'$sort': {'diff', 1}},
    {'$limit': 1}
])
</code></pre>

<p>However, I get the following error:</p>

<pre><code>&lt;class 'tuple'&gt;: (&lt;class 'bson.errors.InvalidDocument'&gt;, InvalidDocument("cannot encode object: {1, 'diff'}, of type: &lt;class 'set'&gt;"), &lt;traceback object at 0x0F5483C8&gt;)
</code></pre>

<p>I think it says I am trying to encode an object with class <code>set</code> which it cannot do so (?) but I could not find the reason.</p>

<p>May I know why this happens and how to fix it? Thanks</p>

