How to fetch certain quantity of objects from mongoDB with mongoose? (Node.js)<p>I have a MongoDB database and a React web page that shows the content using http requests to my Node.js server. This Node.js uses mongoose to communicate with the DB. The react web page shows up to 10 entries per page and it is slow when the database gets big:</p>

<p><a href="https://i.stack.imgur.com/0Tqmp.png" rel="nofollow noreferrer">React web page</a></p>

<p>What Node.js is doing:</p>

<pre><code>router.get("/", async (req, res) =&gt; {
    const movies = await Movie.find()
        .select("-__v")
        .sort("name");
    res.send(movies);
});
</code></pre>

<p>As you can see, Node.js returns all the database and the front end React only displays the 10 entries depending on the page the user is viewing.</p>

<p>It would be optimal to fetch from the database only 10 entries depending on the page the user is looking at.</p>

<p>How can I do that?</p>

<p>Thanks</p>

