How to filter a mongoDb collection based on a foreign key in MEAN stack app?<p>In my MEAN stack app, I have a <code>Venue-Detail</code> component, I am trying to display all upcoming events associated with this venue.</p>

<p>Below is an example of what the <code>venue</code> collection in my mongoDb looks like:</p>

<pre><code>{
    "_id" : ObjectId("5d40590dd4ea332774e940cb"),
    "venue_name" : "diceys",
    "venue_location" : "camden street",
    "__v" : 0
}
</code></pre>

<p>I also have an <code>event</code> collection:</p>

<pre><code>{
    "_id" : ObjectId("5d415feedb87bc4470c560be"),
    "event_name" : "test event",
    "event_venue" : "5d40590dd4ea332774e940cb",
    "event_artist" : "5d406855171c152868ba71c8",
    "event_price" : "10",
    "__v" : 0
}
</code></pre>

<p>As you can see, <code>venue._id</code> is the same as <code>event.event_venue</code>.</p>

<p>I have the below code that gets all events:</p>

<pre><code>getEvents(): void {
    this.eventService
      .getEvents()
        .subscribe((data: Event[]) =&gt; {
            this.events = data;
    });
}
</code></pre>

<p>I've stored the <code>venue_id</code> in a variable below, so I just need to filter events based on that</p>

<pre><code>this.route.paramMap.subscribe(params =&gt; {
    this.venue_id = params.get('id');
});
</code></pre>

<p>Event Service:   </p>

<pre><code>getEvents() {
    return this
      .http
        .get(`${this.uri}`);
}
</code></pre>

<p>But can someone please tell me how I can filter out the <code>events</code> object above based on the venue? I.e. only show events that are linked to this venue.</p>

