Is there a way to run asynchronously typescript class methods without blocking the main thread?<p>I am making an app that gets attachments from certain messages from my outlook mail. I have a Mongodb to store info from these attachments in. The problem is that the process of receiving these attachments is quite time-taking, that's why I want to have it working in another thread apart from the main one, in case I would want to cancel it or track it's progress somehow.</p>

<p>Now I know that the main problem of nodejs is that it's single-threaded. But nevertheless I found several modules, like Bull, Webworker-threads or workerpool that might help me with this, and of course I have tried to use Node's ChildProcess. The main issue with those modules is that they can either run async code from a file or use static functions that doesn't depend on current data (as far as I understood from examples and docs). But in my situation I can't use in this way.</p>

<p>The question is - is there a way for me without changing my whole architecture of code to run asynchronously the class methods?</p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>//sync.running.controller.ts
import { ConfigServiceFuncs } from "../config.service";
import { SyncRunningService } from "./sync.running.service";

export class SyncRunningController {
  constructor(private readonly configService : ConfigServiceFuncs, private     readonly syncService : SyncRunningService) {}

  //Method that runs when a Put request is made

  @Put
    //I want to have it working in another thread so that I could send another requests, like Delete or Get

  async StartUpdate() {
    this.syncService.startSync();
  }
}



//sync.running.service.ts

import {GetMessagesFromMail } from "./code.js";
@Injectable()
export class SyncRunningService {

  constructor(@Inject('SOME_MODEL') private readonly syncModel :  Model&lt;SomeModel&gt;, private readonly configService : ConfigServiceFuncs){}


  async syncFunc(){

    this.syncDatabase();

  }
  
  async SyncDatabase(){

    databaseObjects = await GetMessagesFromMail();
    /*
     Then goes the code for adding info to database 
    */

}

    }
  
}</code></pre>
</div>
</div>
</p>

